4 june 2012

Bill's landlord Rio Lee is insanely hot, but she's also a hypochondriac. When she shows up at his door for the fourth time that week asking him to look at a birthmark, he's had just about enough. But when she tells him that something else might be wrong, she drops her panties and asks him to try out her juicy clit to see if it's broken. Suddenly, Bill becomes un-annoyed.

